import React from "react"
import Plot from 'react-plotly.js'

class Graph extends React.Component {
     render() {
         <Plot 
             data={[
                 {
                     x: [1, 2, 4],
                     y: [2, 6, 3],
                     type: 'scatter',
                     mode: 'lines+points',
                     marker: {color: 'red'},
                 },
                 {type: 'bar',
                 x: [1, 2, 3],
                 y: [2, 5, 3]
                 },
             ]}
             layout= {{width: 320, height: 240, title: "A Fancy Plpt"}}



             />
     }
}

export default Graph
